import React from 'react'
import { Parallax, Background } from 'react-parallax';
import styled from 'styled-components';

const Styles = styled.div`
    .jumbo {
        background: url(${background}) no-repeat fixed bottom;
        background-size: cover;
        color: #efefef;
        height: 200px;
        position: relative;
        z-index: -2;
    }

    .overlay {
        background-color: #000;
        opacity: 0.6;
        position: absolute;
        top: 55;
        left: 0;
        bottom: 0;
        right: 0;
        height: 200px;
        z-index: -1;
    }

    .text {
        color: #efefef;
    }
`;

export const Home = () => (
    <div>
        <Parallax
            bgImage={require('./assets/mountains.jpg')} strength={500}
        >
            <div style={{ width: '100%', height:'100vh'}}>
                <div></div>
            </div>
        </Parallax>
    </div>

)
